import React, { useState } from "react";
import { Box, TextField, Button, Select, MenuItem, InputLabel, FormControl } from "@material-ui/core";

const AddProduct = () => {
    const [category, setCategory] = useState('');
    const handleChangeCategory = (event) => {
        setCategory(event.target.value);
    };
    return (
        <div className='product'>
            <h1>Add Product</h1>
            <Box
                component="form"
                sx={{
                    '& > :not(style)': { m: 1, width: '25ch' },
                }}
                noValidate
                autoComplete="off"
            >
                <FormControl fullWidth>
                    <TextField type="text" className="outlined-basic" label="Name" variant="outlined" />
                </FormControl>

                <FormControl fullWidth>
                    <TextField type="text" className="outlined-basic" label="Price" variant="outlined" />
                </FormControl>

                <FormControl fullWidth>
                    <InputLabel id="demo-simple-select-label">Category</InputLabel>
                    <Select
                        labelId="demo-simple-select-label"
                        id="demo-simple-select"
                        value={category}
                        label="Category"
                        onChange={handleChangeCategory}
                    >
                        <MenuItem value={10}>Mobile</MenuItem>
                        <MenuItem value={20}>laptop</MenuItem>
                        <MenuItem value={30}>Smart Watch</MenuItem>
                        <MenuItem value={30}>Smart Watch</MenuItem>
                    </Select>
                </FormControl>
            </Box>
        </div>
    )
}

export default AddProduct;
